void draw_box(int boxNum, int blank){
	
	short int color = color_box[boxNum];
	
	int x0,y0,x1,y1,x2,y2,x3,y3;
	int dx=0,dy=0;
	if(blank==1){
		
		color = 0x0000; //sets to black if clearing drawing
		dx = dX[boxNum];
		dy = dY[boxNum];
	}	
	
	
	//initializes corners of 2x2 pixel box
	x0 = x_box[boxNum] - dx;
	y0 = y_box[boxNum] - dy;
	
	x1 = x_box[boxNum] +1 -dx;
	y1 = y_box[boxNum] - dy;
	
	x2 = x_box[boxNum] - dx;
	y2 = y_box[boxNum]+1 -dy;
	
	x3 = x_box[boxNum] + 1 - dx;
	y3 = y_box[boxNum] + 1 - dy;
	

	
	plot_pixel(x0,y0,color);
	plot_pixel(x1,y1,color);
	plot_pixel(x2,y2,color);
	plot_pixel(x3,y3,color);
	
}

void draw_connections(int box0, int box1, int blank){
	
	short int color = color_box[box0];
	
	int x0,y0,x1,y1;
	int dx0=0,dy0=0,dx1=0,dy1=0;
	if(blank==1){
		
		color = 0x0000; //sets to black if clearing drawing
		dx0 = dX[box0];
		dy0 = dY[box0];
		dx1 = dX[box1];
		dy1 = dY[box1];
		
	}	
	
	
	//two points to draw the line
	x0 = x_box[box0] - dx0;
	y0 = y_box[box0] - dy0;
	
	x1 = x_box[box1] -dx1;
	y1 = y_box[box1] - dy1;
	
	draw_line(x0,y0,x1,y1,color);
	
}


